  false,\n\t\"url\": null,\n\t\"notes\": \"Throughout this cruise, multibeam data
  will be collected 24 hours a day and XBT casts will be conducted every 6 hours.
  Additionally, EK 60 (split beam) and sub-bottom profile data will be collected 24
  hours per day, with subbottom profile data collection at the discretion of the CO.
  Onboard multibeam data processing will be minimal due to limited staffing. Daily
  or bi-daily multibeam products will be produced according to established shipboard
  SOP and sent to shore through established shipboard SOP.  Onshore mapping physical
  scientists will monitor data quality, cruise progress, and discovery potential.
  Raw EK 60 and subbottom data will be sent to the shoreside repository through established
  shipboard automated archival procedure.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
